  I
  01> WILLIAMS, James Nelson Marcus m on 04.02.1995 to SEBTI, Simin
  b 01.11.1948
  b 15.09.1962
  Marcus b. at Gisborne. He and Simin had a second Persian marriage ceremony on
  15.09.1995 in California. Address: Ohui, PO Box 997, Gisborne. Marcus was
  educated at Hereworth School, Christ's College (prefect, 1st hockey XI, 1st
  rowing VIII, gymnastics) and Canterbury University (BCom). He imported the
  first Gelbvieh cattle into Australasia in 1977 and began farming deer a year
  later. His primary farming interests involve deer at Tolaga Bay and Turihaua
  with a strong emphasis on organics. He maintains a keen interest in alternative health, environmental
  and social matters.
  Simin comes from Iran which she left in 1984 to study at the University of Canterbury. She graduated
  BE(Hons) in electrical engineering by which time she had chosen New Zealand as her 'home'. Her
  application for New Zealand Residency was only achieved after much persistence and endorsement by the
  then Prime Minister, Geoffrey Palmer. Her family now live in California.
  01> WILLIAMS, Serena Mitra
  b 07.01.1997
  Serena b. at home in a birthing pool.
  ace:
  02> WILLIAMS, Susan Rosemary m on 27.03.1976 to KEMP, Gerald Bruce
  b 10.03.1950
  b 13.03.1947
  Susan b. and m. at Gisborne. Gerald, s/o Brian Kemp and Nancy Bruce, b. at Gisborne. Address: Pouriwai,
  PB 7618, Gisborne.
  Susan was educated at Woodford House and trained at Christchurch Public Hospital as a registered nurse
  (1971). Gerald was educated at Wanganui Collegiate School and is a stock farmer specialising in
  Simmental stud cattle.
  01> KEMP, Caroline Rose
  b 27.07.1978
  Caroline b. at Gisborne. She was educated at Woodford House where she was Head of House and a
  Prefect, and she is completing a course in Resource Studies and Tourism at Lincoln University.
  02> KEMP, Jeremy Arnold
  b 09.03.1980
  Jeremy b. at Gisborne. He was educated at Hereworth School and Wanganui Collegiate School where he
  was in the swimming team and the tennis team. He is now studying Viticulture at Lincoln
  University.
  03> KEMP, Hamish Gerald
  b 05.06.1982
  Hamish b. at Gisborne. He was educated at Hereworth School where he was Head Prefect, and is now
  at Wanganui Collegiate School and a member of the 1st rugby XV.
